/*eslint max-len: ["error", { "code": 150 }]*/

import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import PropTypes from 'prop-types';
import base from '../../config/api.js';
let api = base.api();


class Data extends Component {
    static propTypes = {
        match: PropTypes.object.isRequired,
        location: PropTypes.object.isRequired,
        history: PropTypes.object.isRequired
    };
    constructor(props) {
        super(props);
        this.getContent = this.getContent.bind(this);
        this.state = {
            type: this.props.type,
            data: []
        };
    }

    componentDidMount() {
        this.getContent(this.props.type);
    }

    getContent(type) {
        let that = this;
        let filter;

        switch (type) {
            case "all":
                filter = "/data/";
                break;

            case "ip":
                filter = "/data?ip=";
                break;

            case "url":
                filter = "/data?url=";
                break;

            default:
                this.setState({
                    data: [
                        <p>Start</p>
                    ]
                });
        }

        if (filter) {
            let data = [];
            if (!this.state.res) {
                fetch(api + filter)
                    .then(res => res.json())
                    .then(function (res) {
                        this.state.res = res;
                        for (let i = 0; i <= 20; i++) {
                            data.push(
                                <tr key={res[i].ip}>
                                    <td width="20%">{ res[i].ip }</td>
                                    <td width="40%">{ res[i].url }</td>
                                    <td width="20%">{ res[i].day + " " + res[i].month + " " + res[i].year }</td>
                                    <td width="20%">{ res[i].time }</td>
                                </tr>
                            )
                        };
                        return true;
                    })
                    .then(() => this.setState({
                        data: [
                            <table className="fixed-table">
                                <tr>
                                    <th>IP</th>
                                    <th>URL</th>
                                    <th>Date</th>
                                    <th>Time</th>
                                </tr>
                                { data }
                            </table>
                        ]
                    }))
                }
        }


    }
    render() {
        return (
            <article>
                { this.state.data[0] }
            </article>
        );
    }
}

export default Data;
